NEWBIE_TOOLTIP_ADDFRIEND = "Aggiunge un personaggio all'elenco amici. Riceverai un messaggio quando un amico accede o si disconnette. Gli altri giocatori non possono sapere se sono o meno nel tuo elenco amici.";
NEWBIE_TOOLTIP_ADDMEMBER = "Aggiunge un personaggio alla gilda.";
NEWBIE_TOOLTIP_ALLIANCE = "Un orgoglioso membro dell'Alleanza, in guerra contro l'Orda (Orchi, Troll, Tauren, Non Morti, Elfi del Sangue e Goblin).";
NEWBIE_TOOLTIP_BATTLEFIELDMINIMAP_OPTIONS = "Clicca col pulsante destro per ottenere un elenco di opzioni personalizzabili per questa finestra. Tieni premuto il pulsante sinistro e trascina per muovere la finestra.";
NEWBIE_TOOLTIP_BATTLEFIELD_GROUP_JOIN = "Se sei il capo di un gruppo, clicca qui per aggiungere l'intero gruppo alla coda d'attesa del campo di battaglia. Ciò ti garantisce di entrare nel campo di battaglia tutti assieme. I membri che si uniscono al gruppo dopo che hai cliccato o che sono in coda anche per un altro campo di battaglia, potrebbero entrare in un'altra istanza.";
NEWBIE_TOOLTIP_CHARACTER = "Mostra informazioni sul tuo personaggio, tra cui l'equipaggiamento, le statistiche di combattimento e la reputazione.";
NEWBIE_TOOLTIP_CHATMENU = "Comandi per comunicare con altri. Dal menu di chat puoi parlare con le persone che ti stanno vicino, inviare un messaggio privato, chiacchierare con i membri del tuo gruppo, salutare un amico o creare una macro.";
NEWBIE_TOOLTIP_CHATOPTIONS = "Clicca col pulsante destro per ottenere un elenco di opzioni personalizzabili per questa finestra. Tieni premuto il pulsante sinistro e trascina per muovere la finestra.";
NEWBIE_TOOLTIP_DEMOTE = "Degrada il personaggio selezionato.";
NEWBIE_TOOLTIP_DISHONORABLE_KILLS = "Ogni volta che partecipi nell'uccisione di un civile in PvP di livello così basso da non fornire esperienza (con il livello in grigio), ottieni un'uccisione disonorevole. Le uccisioni disonorevoli riducono leggermente il tuo grado e uccisioni disonorevoli multiple in un solo giorno hanno un effetto maggiore. Le uccisioni disonorevoli vengono applicate direttamente al tuo grado.";
NEWBIE_TOOLTIP_ENCHANTSLOT = "Posiziona un oggetto in questo scomparto per permettere ad altri giocatori di aprire un contenitore o incantare un oggetto. L'oggetto posizionato in questo scomparto non verrà commerciato: una volta modificato tornerà nell'inventario del proprietario.";
NEWBIE_TOOLTIP_ENTER_BATTLEGROUND = "Unisciti alla coda per entrare in questo campo di battaglia appena si libera uno spazio. L'attesa sarà più lunga che selezionando \"Primo disponibile\".";
NEWBIE_TOOLTIP_FIRST_AVAILABLE = "Unisciti alla coda per entrare nel primo campo di battaglia disponibile. Se selezioni \"Primo disponibile\" e un altro membro del gruppo entra prima di te in un campo di battaglia, quel campo di battaglia sarà considerato il preferito.";
NEWBIE_TOOLTIP_FRIENDSTAB = "Permette di gestire l'elenco dei giocatori con cui ti diverti a giocare. Riceverai una notifica quando un amico si connette o si disconnette.";
NEWBIE_TOOLTIP_GROUPINVITE = "Invita il personaggio selezionato a unirsi al tuo gruppo.";
NEWBIE_TOOLTIP_GUILDCONTROL = "Permette di personalizzare i nomi di ogni grado di gilda e di stabilirne i privilegi.";
NEWBIE_TOOLTIP_GUILDGROUPINVITE = "Invita il membro di gilda selezionato a unirsi al tuo gruppo.";
NEWBIE_TOOLTIP_GUILDPUBLICNOTE = "Clicca per visualizzare la tua nota pubblica. Questa informazione potrà essere vista da altri giocatori nell'interfaccia di gilda. Se clicchi sulla nota, potrai modificarla.";
NEWBIE_TOOLTIP_GUILDREMOVE = "Rimuove il personaggio selezionato dalla gilda.";
NEWBIE_TOOLTIP_GUILDTAB = "Permette di visualizzare informazioni sulla gilda e sui personaggi che ne fanno parte. Se sei un ufficiale, da questa scheda puoi anche gestire la gilda.";
NEWBIE_TOOLTIP_GUILD_MEMBER_OPTIONS = "Clicca col pulsante destro su un membro di gilda per ulteriori opzioni.";
NEWBIE_TOOLTIP_HEALTHBAR = "Questa è la quantità di salute che attualmente possiedi. Se la tua salute arriva a zero, morirai. La salute si rigenera automaticamente quando non sei in combattimento.";
NEWBIE_TOOLTIP_HELP = "Per risolvere il problema riscontrato, accedi all'aiuto di base online o contatta un Game Master (GM).";
NEWBIE_TOOLTIP_HONORABLE_KILLS = "Ogni volta che tu o un membro del tuo gruppo danneggia un giocatore in PvP che viene successivamente ucciso, guadagna un'uccisione onorevole. Ottieni un'uccisione onorevole solo se il livello del bersaglio è verde o superiore (esattamente come succede per l'esperienza con i mostri). Solo uccidendo i giocatori nemici puoi ottenere uccisioni onorevoli.";
NEWBIE_TOOLTIP_HONOR_CONTRIBUTION_POINTS = "L'onore viene guadagnato partecipando a delle uccisioni onorevoli in combattimenti PvP. La quantità di onore ottenuta è proporzionale al danno che tu (o il tuo gruppo) avete causato al personaggio ucciso. L'onore così ottenuto viene diviso tra tutti i membri del gruppo o dell'incursione. Inoltre otterrai meno onore se ucciderai lo stesso giocatore consecutivamente in un periodo di tempo troppo corto, fin quando l'uccisione stessa non fornirà più alcun onore.";
NEWBIE_TOOLTIP_HONOR_STANDING = "Il prestigio rappresenta la tua posizione comparata a quella degli altri giocatori della tua fazione (Orda o Alleanza). Se il tuo prestigio è di 150, significa che ci sono 149 giocatori che hanno ottenuto più onore di te nello stesso periodo di tempo. Devi ottenere almeno 25 uccisioni onorevoli in una settimana per ottenere prestigio e grado.";
NEWBIE_TOOLTIP_HORDE = "Un orgoglioso membro dell'Orda, in guerra contro l'Alleanza (Elfi della Notte, Nani, Umani, Gnomi, Draenei e Worgen).";
NEWBIE_TOOLTIP_IGNOREPLAYER = "Aggiunge un personaggio all'elenco ignorati. Non riceverai più messaggi o altre comunicazioni testuali dai personaggi nell'elenco ignorati, ed essi non potranno comunicare con te in alcun modo.";
NEWBIE_TOOLTIP_IGNORETAB = "Permette di modificare l'elenco dei giocatori che stai attualmente ignorando.";
NEWBIE_TOOLTIP_LATENCY = "Indica il tempo necessario per comunicare con il server di gioco. Latenze molto alte (in rosso) possono indicare un problema con la tua connessione a Internet.";
NEWBIE_TOOLTIP_MAINMENU = "Modifica le impostazioni, cambia l'assegnazione dei tasti o esci dal gioco.";
NEWBIE_TOOLTIP_MANABAR0 = "Questa è la quantità di mana che attualmente possiedi. Alcuni personaggi utilizzano il mana per lanciare incantesimi. Il mana si rigenera automaticamente se non lanci incantesimi per almeno cinque secondi.";
NEWBIE_TOOLTIP_MANABAR1 = "I Guerrieri (e i Druidi in Forma d'Orso o in Forma d'Orso Feroce) utilizzano la rabbia per attivare le proprie abilità.";
NEWBIE_TOOLTIP_MANABAR2 = "I Cacciatori utilizzano il focus per attivare le proprie abilità. Il focus si rigenera restando fermi.";
NEWBIE_TOOLTIP_MANABAR3 = "I Ladri (e i Druidi in Forma Felina) utilizzano l'energia per attivare le proprie abilità.";
NEWBIE_TOOLTIP_MANABAR4 = "Questo è il livello di felicità del tuo famiglio. Famigli contenti infliggono danni normali ai nemici, famigli felici infliggono danni superiori mentre i famigli infelici infliggono danni ridotti. La felicità scende quando il famiglio muore o diventa affamato e sale quando viene sfamato.";
NEWBIE_TOOLTIP_MINIMAPTOGGLE = "Mostra o nasconde la minimappa.";
NEWBIE_TOOLTIP_PARTYOPTIONS = "Se fai parte di un gruppo, puoi cliccare col pulsante destro sul tuo ritratto per accedere al menu delle opzioni del gruppo. Questo menu ti permette di lasciare il gruppo o consultare le opzioni di predazione attualmente in uso. Il capogruppo può aggiungere o rimuovere membri dal gruppo e cambiare le regole di predazione.";
NEWBIE_TOOLTIP_PLAYEROPTIONS = "Clicca col pulsante destro per visualizzare comandi speciali per interagire con altri giocatori. Puoi ispezionare il loro equipaggiamento, invitarli nel tuo gruppo, avviare un commercio o sfidarli a un duello. Il capogruppo può promuovere o rimuovere personaggi dal gruppo.";
NEWBIE_TOOLTIP_PROMOTE = "Promuove il personaggio selezionato.";
NEWBIE_TOOLTIP_PVPFFA = "Adesso puoi attaccare o essere attaccato da qualsiasi giocatore.";
NEWBIE_TOOLTIP_QUESTLOG = "L'elenco delle missioni attive attualmente a tua disposizione. Puoi avere al massimo 25 missioni attive contemporaneamente.";
NEWBIE_TOOLTIP_RAIDTAB = "Permette di vedere o modificare il tuo gruppo di incursione. Le incursioni sono gruppi composti da più di cinque personaggi e vengono utilizzati per affrontare le sfide più difficili ai livelli più alti.";
NEWBIE_TOOLTIP_RANK = "Il grado è il risultato ottenuto dal calcolo del sistema di gestione dell'onore. A seconda del rapporto tra il prestigio ottenuto nella settimana con il tuo grado attuale, questo può salire, scendere o restare invariato. I personaggi di livello superiore salgono più rapidamente di grado (e scendono più lentamente) rispetto a quelli di livello inferiore; inoltre, il grado aumenta più rapidamente se hai un grado inferiore rispetto a un grado superiore.";
NEWBIE_TOOLTIP_RANK_POSITION = "La tua posizione nel grado. Questa barra indica quanto ti manca per ottenere il grado successivo o per scendere al grado precedente. La barra e l'onore vengono aggiornati solo una volta alla settimana.";
NEWBIE_TOOLTIP_REMOVEFRIEND = "Rimuove il personaggio selezionato dall'elenco amici.";
NEWBIE_TOOLTIP_SENDMESSAGE = "Invia un messaggio privato al personaggio selezionato.";
NEWBIE_TOOLTIP_SHAREQUEST = "Permette di condividere una missione con tutti membri del tuo gruppo che ne soddisfano i requisiti. Alcune missioni, come quelle ottenute dagli oggetti, non possono essere condivise.";
NEWBIE_TOOLTIP_SOCIAL = "Mostra informazioni su altri personaggi del gioco. Puoi utilizzare la finestra sociale per gestire l'elenco amici e l'elenco ignorati, e per vedere chi è attualmente online.";
NEWBIE_TOOLTIP_SPELLBOOK = "Per accedere più facilmente a un incantesimo o a un'abilità, apri il grimorio e trascina col pulsante sinistro l'incantesimo o l'abilità in una barra delle azioni.";
NEWBIE_TOOLTIP_STOPIGNORE = "Rimuove il personaggio selezionato dall'elenco ignorati.";
NEWBIE_TOOLTIP_TALENTS = "Mostra i talenti disponibili per potenziare e specializzare il tuo personaggio.";
NEWBIE_TOOLTIP_UNIT_DUEL = "Sfida il personaggio selezionato in un duello. Perde il primo giocatore che finisce la salute.";
