TUTORIAL1 = "I committenti hanno un punto esclamativo sopra la testa. Clicca col pulsante destro per ricevere la missione."; -- changed
TUTORIAL12 = "Puoi bere per recuperare più velocemente il mana. Clicca col pulsante destro su una bevanda per berla.|n|nNon è necessario bere se la tua classe non fa uso di mana."; -- changed
TUTORIAL13 = "Puoi apprendere un nuovo talento dall'interfaccia dei talenti.|n|nApri la finestra dell'interfaccia cliccando sul pulsante Specializzazione e talenti nella barra delle azioni."; -- changed
TUTORIAL14 = "Puoi visitare il tuo istruttore di classe per apprendere nuove abilità. Clicca col pulsante destro su un istruttore per parlarci.|n|nGli istruttori si trovano nei paesi e nelle città, e sempre nelle zone di partenza. Potresti dover cercare un po' in giro prima di trovarlo."; --changed
TUTORIAL15 = "Puoi spostare incantesimi e abilità nella barra delle azioni cliccando sul pulsante Grimorio nella parte inferiore dello schermo e trascinando l'icona dell'abilità prescelta.|n|nPuoi utilizzare un incantesimo o un'abilità direttamente dal grimorio cliccando su di esso."; -- changed
TUTORIAL16 = "Sulla scheda reputazione puoi controllare lo stato della tua relazione con le varie fazioni presenti nel gioco.|n|nClicca sul pulsante Info personaggio per accedere alla scheda reputazione."; -- changed
TUTORIAL17 = "Puoi rispondere al personaggio premendo il tasto R o digitando /sussurra <personaggio>, seguito poi dal messaggio.";
TUTORIAL18 = "Puoi invitare un altro giocatore nel tuo gruppo cliccando col pulsante destro sul suo ritratto e selezionando Invita dal menu a comparsa.|n|nPuoi abbandonare un gruppo cliccando col pulsante destro sul tuo ritratto e selezionando l'opzione Abbandona gruppo."; -- changed
TUTORIAL19 = "Questo è il personaggio di un giocatore. Lo puoi capire dal nome in blu sulla testa.";
TUTORIAL2 = "Premi i tasti W, A, S, D per muovere il tuo personaggio.";
TUTORIAL20 = "Clicca col pulsante destro su un oggetto nel pannello del mercante per acquistarlo (se hai abbastanza denaro).|n|nQuando è aperto il pannello del mercante, potrai vendere gli oggetti nel tuo inventario cliccandoci sopra col pulsante destro."; -- changed
TUTORIAL21 = "Puoi visualizzare le missioni attive cliccando sul pulsante Registro missioni nella parte inferiore dello schermo.|n|nPuoi visualizzare le aree dove svolgere la missione cliccando sul pulsante Mappa nella parte superiore destra dello schermo."; -- changed
TUTORIAL22 = "Se ti sei divertito a giocare con un altro giocatore, aggiungilo al tuo elenco amici! Clicca sul pulsante |cffffd200Sociale|r e aggiungilo all'elenco.|n|nPuoi aggiungere solo giocatori del tuo stesso reame.";
TUTORIAL23 = "Puoi inviare un messaggio premendo Invio, digitando il testo e premendo nuovamente Invio. Gli altri giocatori vicini potranno sentire quello che hai da dire.";
TUTORIAL24 = "Per equipaggiare un oggetto, clicca prima sul pulsante Info personaggio nella parte inferiore dello schermo e poi sul pulsante dello Zaino nella parte inferiore destra dello schermo.|n|nA questo punto trascina un oggetto equipaggiabile dallo zaino su uno scomparto del tuo personaggio."; -- changed
TUTORIAL25 = "Sei diventato un fantasma. Puoi tornare in vita ritrovando il tuo cadavere o parlando con il guaritore spirituale qui vicino.|n|nLa posizione del tuo cadavere viene mostrata con un'icona sulla minimappa posta nella parte superiore destra dello schermo.";
TUTORIAL26 = "Sei riposato. In questa condizione, guadagnerai esperienza bonus uccidendo i mostri.";
TUTORIAL27 = "Se ti avventuri in acque profonde o inesplorate, compare la barra della fatica. Se diventi completamente affaticato, inizierai ad affogare.";
TUTORIAL28 = "Nuotare è come camminare, tranne che puoi inclinarti verso l'alto e il basso tenendo premuto il pulsante destro e spostando lo sguardo nella direzione in cui vuoi procedere."; -- changed
TUTORIAL29 = "Quando il tuo personaggio si trova sott'acqua, compare la barra del respiro. Se resti senza fiato, inizierai ad affogare.";
TUTORIAL3 = "Puoi far girare il tuo personaggio tenendo premuto il pulsante destro e muovendo il mouse.|n|nPuoi guardarti in giro tenendo premuto il pulsante sinistro e muovendo il mouse."; -- changed
TUTORIAL30 = "Ti stai riposando, e questo viene indicato dal tuo ritratto illuminato di giallo. Il tempo passato a riposarti (non importa se sei connesso o meno) fornisce un temporaneo bonus all'esperienza ottenuta uccidendo i mostri.|n|nPuoi rapidamente tornare a una locanda utilizzando la Pietra del Ritorno.";
TUTORIAL31 = "Le Pietre del Ritorno possono essere utilizzate per trasportarti alla locanda dove hai stabilito la tua dimora.";
TUTORIAL32 = "Hai attivato la modalità Personaggio vs Personaggio. Quando ciò succede, comparirà il simbolo della tua fazione vicino al tuo ritratto e i giocatori nemici potranno attaccarti.";
TUTORIAL33 = "Premi Spazio per far saltare il tuo personaggio. Puoi saltare per superare gli ostacoli o anche solo per divertirti."; -- changed
TUTORIAL34 = "CONGRATULAZIONI! Hai completato la tua prima missione!";
TUTORIAL35 = "Questo è un maestro di volo che addestra creature volanti a portare passeggeri da un luogo a un altro. In cambio di un compenso, puoi rapidamente volare fino a un altro maestro di volo con cui hai parlato precedentemente.|n|nQuando scopri una nuova città, parla con il maestro di volo per poterci tornare rapidamente in un secondo momento.";
TUTORIAL36 = "L'integrità di uno dei tuoi oggetti è bassa. L'icona del personaggio sotto la minimappa mostra l'oggetto danneggiato in giallo.|n|nTrova un mercante capace di riparare l'oggetto prima che si rompa.";
TUTORIAL37 = "Uno dei tuoi oggetti si è rotto! L'icona del personaggio sotto la minimappa mostra l'oggetto rotto in rosso.|n|nTrova un mercante capace di riparare l'oggetto. Fin quando non lo farai, non otterrai alcun beneficio dall'oggetto rotto.";
TUTORIAL38 = "Il tuo personaggio può imparare delle professioni, come Cucina o Forgiatura, che ti permetteranno di creare oggetti di valore.|n|nPer saperne di più sulle professioni, chiedi a una guardia nelle capitali di indirizzarti verso gli Istruttori delle Professioni.";
TUTORIAL39 = "Puoi invitare altri giocatori nel tuo gruppo per sconfiggere più facilmente i nemici.|n|nMolte missioni difficili possono così essere completate rapidamente, visto che il merito del completamento viene assegnato a tutti i membri del gruppo. Inoltre, i gruppi ottengono esperienza bonus rispetto ai giocatori singoli.";
TUTORIAL40 = "Hai imparato un nuovo incantesimo o abilità! Clicca sul pulsante Grimorio e abilità nella parte inferiore dello schermo per aprire il Grimorio. Clicca col pulsante sinistro e trascina un incantesimo o un'abilità sulla barra delle azioni.\n\nIl Grimorio riporta le abilità e gli incantesimi passivi dopo quelli attivi."; -- changed
TUTORIAL41 = "Hai accettato una missione élite. Questo tipo di missioni dovrebbero essere intraprese in gruppo, perché ti porteranno in zone infestate da creature élite.|n|nLe creature élite sono sensibilmente più forti dei mostri normali, ma forniscono anche più esperienza una volta uccise. Puoi riconoscere una creatura élite dal drago dorato attorno al suo ritratto.";
TUTORIAL42 = "Per iniziare, dovresti cominciare una Missione|r.|n|nC'è un committente proprio di fronte a te. I consigli del tutorial ti aiuteranno lungo la strada.|n|nGrazie per aver seguito il tutorial e buona fortuna con le tue avventure!";
TUTORIAL43 = "Un committente con un '!' grigio sopra la testa indica che sei di livello troppo basso per accettare le sue missioni. Torna dopo aver ottenuto qualche altro livello.";
TUTORIAL44 = "Hai ottenuto un'arma a distanza. Per usarla, apri il pannello Info personaggio e il tuo Zaino, quindi trascina l'oggetto sul tuo personaggio.|n|nOra apri il tuo Grimorio e trascina l'abilità Attacco a distanza o Lancia sulla barra delle azioni.|n|nSolo i Cacciatori, i Guerrieri e i Ladri possono usare le armi a distanza. Maghi, Sacerdoti e Stregoni possono usare le bacchette."; -- changed
TUTORIAL45 = "Non puoi utilizzare archi o armi da fuoco senza munizioni. Per acquistarle, visita un mercante di archi o armi da fuoco in una città. Per equipaggiare le munizioni, cliccaci sopra col pulsante destro."; -- changed
TUTORIAL46 = "Ti sei unito a un gruppo di incursione: è un gruppo con un limite massimo di 40 membri, anche se normalmente sono 10 o 25. I gruppi di incursione sono necessari per entrare nelle istanze più impegnative o per sconfiggere i nemici più potenti, solitamente ad alti livelli.|n|nQuando sei in un gruppo di incursione, non otterrai il riconoscimento per il completamento della maggior parte delle missioni. Per abbandonare un gruppo di incursione, clicca col pulsante destro sul tuo ritratto e seleziona Abbandona gruppo."; -- changed
TUTORIAL47 = "Hai ora accesso alla barra dei totem! Qui comparirà un nuovo comando quando otterrai l'accesso a un totem di un nuovo elemento.|n|nIn questa barra puoi impostare un totem per ogni elemento disponibile. A livelli più alti, otterrai l'abilità di piazzare più totem alla volta.";
TUTORIAL48 = "Sei ora in coda per entrare in un campo di battaglia. Puoi controllare lo stato dell'attesa spostando il puntatore del mouse sull'icona della minimappa.";
TUTORIAL49 = "Ora puoi accedere alla battaglia. Clicca su \"Entra in battaglia\" o clicca col pulsante destro sull'icona del campo di battaglia sulla minimappa.";
TUTORIAL5 = "Per attaccare i nemici, clicca sugli incantesimi nella barra delle azioni."; -- changed
TUTORIAL50 = "Ora hai un portachiavi dove conservare le chiavi che raccogli. Il pulsante Portachiavi appare a sinistra delle tue sacche, sulla barra delle azioni.";
TUTORIAL6 = "La maggior parte delle tue abilità sono attacchi con le armi o incantesimi.|n|nA seconda della tua classe potresti avere abilità difensive o incantesimi di cura sulla tua barra delle azioni.";
TUTORIAL7 = "Quando sconfiggi un nemico e il suo cadavere scintilla, significa che possiede un bottino.|n|nCliccando col pulsante destro sul cadavere, si aprirà la finestra del bottino. Clicca col pulsante destro su un oggetto per spostarlo nel tuo zaino."; -- changed
TUTORIAL8 = "Un oggetto è stato messo nel tuo zaino.|n|nPuoi cliccare sul pulsante dello Zaino nella parte inferiore destra dello schermo per aprirlo. Sposta il puntatore del mouse sull'oggetto per vedere di cosa si tratta."; -- changed
TUTORIAL9 = "Alcuni oggetti possono essere utilizzati. Clicca col pulsante destro su un oggetto per usarlo.|n|nPuoi trascinare l'oggetto nella barra delle azioni se vuoi utilizzarlo senza dover aprire il tuo inventario."; -- changed
