VOICEMACRO_20_Sc_2_FEMALE = "Il mio umore è decrepito.";
VOICEMACRO_20_Sc_3 = "Il comandante della guarnigione di Roccavento si avvicina a una meretrice, e le chiede: \"Per 30 monete d'argento, accetteresti la mia compagnia?\". Lei risponde: \"30 monete? Ma certo!\". \"Bene,\" dice il comandante, \"Compagnia: avanti!\".";
VOICEMACRO_20_Sc_3_FEMALE = "Qui qualcosa puzza.";
VOICEMACRO_20_Sc_4 = "Qualcuno ha dell'odorante? Mi andrebbe bene \"Cane bagnato\", \"Rifiuti freschi\" o \"Cozze al sole\".";
VOICEMACRO_20_Sc_4_FEMALE = "Quando sei morto, niente puzza più. Uova marce? Nessun problema. Pesce morto? Come una brezza primaverile.";
VOICEMACRO_20_Sc_5_FEMALE = "Non ti serve il deodorante quando non hai le ascelle.";
VOICEMACRO_20_Sc_6_FEMALE = "Ah, che bel mortuario.";
VOICEMACRO_20_Sc_7_FEMALE = "Una volta ho sentito schioccare la mia rotula, poi l'ho vista rimbalzare sulla superficie di un lago fino all'altra sponda.";
VOICEMACRO_20_Ta_0 = "Se disturbi il toro, aspettati le corna.";
VOICEMACRO_20_Ta_0_FEMALE = "Nella mia lingua nativa, il mio nome significa \"Balla con i montoni\".";
VOICEMACRO_20_Ta_1 = "Vuoi del manzo?";
VOICEMACRO_20_Ta_1_FEMALE = "Una volta ho riso così forte che ho sparso latte dappertutto.";
VOICEMACRO_20_Ta_2 = "Uomogeneizzato? Neanche per sogno, a me piacciono le femmine.";
VOICEMACRO_20_Ta_2_FEMALE = "I Tauren più felici vengono da Mulgore.";
VOICEMACRO_20_Ta_3 = "Devi sapere che noi Tauren siamo cacciatori nati. Hai mai visto un Tauren catturare un salmone che risale la corrente? È una cosa davvero eccitante. E hai mai visto un Tauren inseguire un pitone? Certo che no. Questo perché i Tauren sono abilissimi a confondersi con l'ambiente.";
VOICEMACRO_20_Ta_3_FEMALE = "Hai idea di quant'è difficile lasciarsi andare quando sai che lo spirito della tua bisnonna ti sta osservando?";
VOICEMACRO_20_Ta_4 = "Muuu. Sei felice ora?";
VOICEMACRO_20_Tr_0 = "È pronto da mangiare. Ci sta 'o stufato.";
VOICEMACRO_20_Tr_0_FEMALE = "Tengo n'alito che acciderebbe nu Tauren.";
VOICEMACRO_20_Tr_1 = "Mi piacciono 'e femmine chiatte e con l'alitosi.";
VOICEMACRO_20_Tr_1_FEMALE = "Oh come sono bella, oh quanto sono bella! (sputa)";
VOICEMACRO_20_Tr_2 = "Mi si è ristretta 'a capa pecché sono uscito mo' mo' dall'acqua.";
VOICEMACRO_20_Tr_2_FEMALE = "Tengo tutto chisto da offrire, ma anche tanta personalità.";
VOICEMACRO_20_Tr_3 = "Nuovo Troll in città.";
VOICEMACRO_20_Tr_3_FEMALE = "'A via per 'o core di nu maschio è attraverso 'o stomaco, ma io preferisco passare per 'e costole.";
VOICEMACRO_20_Tr_4 = "Ho acciso due Nani alla mattina e due Nani alla sera. Ho acciso due Nani nel pomeriggio e finalmente sono stato bene. Ho acciso due Nani in tempo di pace e due in tempo di guerra. Ho acciso due Nani prima di accidere due Nani, e poi ne ho accisi altri due.";
VOICEMACRO_20_Tr_4_FEMALE = "Se li cannibali tengono torto, io nun voglio tenere ragione.";
VOICEMACRO_20_Tr_5 = "Dicono che se ti tagli n'estremità, chella poi ti ricresce cchiù grossa. Sono fesserie!";
